import React from 'react';
import {connect } from 'react-redux';
import { deleteUser } from '../actions/index'

function PrintUser ({ users }) {
  return(
    <ul>
      { users.users.map((value) => ( <ul key = {value.id}> 
              <li>   
                Id : {value.id}<br/>
                Name:{value.name}<br />
                Username : {value.username}<br/>
                Email:{value.email}<br/>
                <h4>Address:</h4>
                Street:{value.address.street}<br/>
                Suite:{value.address.suite}<br/>
                City:{value.address.city}<br/>
                Zipcode:{value.address.zipcode}<br/>
                Latitude:{value.address.geo.lat}<br/>
                Longitude:{value.address.geo.lng}<br/>
                Phone:{value.phone}<br/>
                Website:{value.website}

                <h4>Company:</h4>
                Name:{value.company.name}<br/>
                CatchPhrase:{value.company.catchPhrase}<br/>
                Bs:{value.company.bs}

                {/* <Link to = {`users/${value.id}`}> */}
                  <button type='button' onClick = { () => {this.props.deleteUser(value.id)} } >
                    Delete
                  </button>
                  <button type='button' onClick = { () => {this.props.updateUser(value.id)} } >
                    Update
                  </button>

                {/* </Link> */}
                <br/><hr />
              </li>  
              </ul>
            ))
        }
    </ul>
 );
};

export default connect(null , { deleteUser })(PrintUser);
